import React from 'react'
import Game from '../Game'
import games from "./components/data/games"

const GamesList = ({name, genre, mode}) => {
    return (
        <div id="list">
            <Game name={games.name} genre={games.genre} mode={games.mode} />
        </div>
    )
}

export default GamesList
